import React, { useState } from "react";
import "./App.css";

function App() {
  const [activeSection, setActiveSection] = useState("home");

  const handleSectionChange = (section) => {
    setActiveSection(section);
  };

  const renderContent = () => {
    switch (activeSection) {
      case "home":
        return <div>Welcome to Lucky Software Solutions! Your trusted partner for software development.</div>;
      case "services":
        return <div>Our Services: Web Development, Mobile Apps, Custom Software, and More.</div>;
      case "about":
        return <div>About Us: We deliver quality software solutions tailored to your needs.</div>;
      case "contact":
        return <div>Contact Us: Reach us at luckysoftwaresolutions.site or call +1234567890.</div>;
      case "privacy":
        return <div>Privacy Policy: We respect your privacy and data security.</div>;
      default:
        return <div>Welcome to Lucky Software Solutions!</div>;
    }
  };

  return (
    <div className="app">
      <header className="header">
        <div className="logo-section">
          <img
            className="logo-img"
            src="https://res.cloudinary.com/dj0u6aez5/image/upload/v1737991932/android-chrome-192x192_qucq2j.png"
            alt="Logo"
          />
          <span className="logo">luckysoftwaresolutions.site</span>
        </div>
        <nav className="nav">
          <button onClick={() => handleSectionChange("home")}>Home</button>
          <button onClick={() => handleSectionChange("services")}>Services</button>
          <button onClick={() => handleSectionChange("about")}>About Us</button>
          <button onClick={() => handleSectionChange("contact")}>Contact Us</button>
          <button onClick={() => handleSectionChange("privacy")}>Privacy Policy</button>
        </nav>
        <div className="header-icons">
          <a href="tel:+1234567890">üìû</a>
          <a href="mailto:info@luckysoftwaresolutions.site">‚úâÔ∏è</a>
          <a href="sms:+1234567890">üí¨</a>
          <a href="https://wa.me/1234567890" target="_blank" rel="noopener noreferrer">üì±</a>
          <a href="https://www.google.com/maps?q=Lucky+Software+Solutions" target="_blank" rel="noopener noreferrer">üìç</a>
        </div>
      </header>

      <section className="scroll-section">
        <div className="scroll-content">
          <p>Your one-stop solution for all software needs! Get in touch today.</p>
        </div>
      </section>

      <main className="content">
        {renderContent()}
        <div className="home-button">
          <button onClick={() => handleSectionChange("home")}>Home</button>
        </div>
      </main>

      <footer className="footer">
        <p>¬© 2025 Lucky Software Solutions. All rights reserved.</p>
        <a href="#privacy">Privacy Policy</a>
        <a href="#disclaimer">Disclaimer</a>
      </footer>
    </div>
  );
}

export default App;
